import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const ManageQuestions = () => {
  const [question, setQuestion] = useState("");
  const [category, setCategory] = useState("");
  const [activeQuestions, setActiveQuestions] = useState([]);
  const [generatedLink, setGeneratedLink] = useState("");
  const navigate = useNavigate(); // React Router navigation hook

  const handleAddQuestion = () => {
    if (question.trim() && category) {
      setActiveQuestions([...activeQuestions, { id: Date.now(), question, category }]);
      setQuestion("");
      setCategory("");
    } else {
      alert("Please enter a question and select a category.");
    }
  };

  const handleGenerateLink = async () => {
    const payload = {
      questions: activeQuestions,
      deadline: "2024-12-31T23:59:59", // Replace with a dynamic deadline if needed
      duration: 60, // Replace with a dynamic duration if needed
    };

    try {
      const response = await axios.post("http://localhost:5001/api/questions/generate-link", payload);
      console.log("Response from API:", response.data); // Debugging response
      setGeneratedLink(response.data.exam.link);

      // Navigate to the exam page using the link
      const examId = response.data.exam.id; // Extract exam ID from response
      navigate(`/exam/${examId}`);
    } catch (error) {
      console.error("Error generating link:", error.response?.data || error.message);
      alert(error.response?.data?.error || "Failed to generate exam link.");
    }
  };

  return (
    <div className="p-6 bg-gray-100 min-h-screen">
      <h1 className="text-3xl font-semibold text-gray-800 mb-6">Manage Questions</h1>

      {/* Add Question Section */}
      <div className="bg-white shadow-md rounded-lg p-6 mb-8">
        <h2 className="text-lg font-semibold text-gray-800 mb-4">Add Question</h2>
        <div className="flex items-center space-x-4">
          <input
            type="text"
            className="border rounded-md p-2 flex-grow"
            placeholder="Enter a question"
            value={question}
            onChange={(e) => setQuestion(e.target.value)}
          />
          <select
            className="border rounded-md p-2"
            value={category}
            onChange={(e) => setCategory(e.target.value)}
          >
            <option value="">Select Category</option>
            <option value="General">General</option>
            <option value="Essay">Essay</option>
            <option value="Multiple Choice">Multiple Choice</option>
          </select>
          <button
            onClick={handleAddQuestion}
            className="bg-yellow-500 text-white px-4 py-2 rounded-md"
          >
            Add Question
          </button>
        </div>
      </div>

      {/* Active Questions Section */}
      <div className="bg-white shadow-md rounded-lg p-6 mb-8">
        <h2 className="text-lg font-semibold text-gray-800 mb-4">Active Questions</h2>
        {activeQuestions.length > 0 ? (
          <ul>
            {activeQuestions.map((q) => (
              <li key={q.id} className="flex justify-between items-center py-2 border-t">
                <span>
                  <strong>{q.category}: </strong>
                  {q.question}
                </span>
              </li>
            ))}
          </ul>
        ) : (
          <p className="text-gray-600">No active questions available.</p>
        )}
        <button
          onClick={handleGenerateLink}
          className="bg-blue-500 text-white px-4 py-2 rounded-md mt-4"
        >
          Generate Exam Link
        </button>
        {generatedLink && (
          <div className="mt-4 p-4 bg-green-100 text-green-800 rounded-md">
            <p>Generated Link:</p>
            <a href={generatedLink} target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">
              {generatedLink}
            </a>
          </div>
        )}
      </div>
    </div>
  );
};

export default ManageQuestions;
